import React from "react";
import ProductCard from "./ProductCard";

// Dữ liệu mẫu
const productList = [
  {
    id: 1,
    name: "Vợt Yonex Astrox 99 Pro",
    img: "img/product/hinh13.png",
    priceSale: "3.500.000đ",
    priceOld: "3.900.000đ",
    stars: 5
  },
  {
    id: 2,
    name: "Vợt Lining Calibar 300",
    img: "img/product/hinh14.png",
    priceSale: "2.800.000đ",
    priceOld: "3.200.000đ",
    stars: 4
  },
  {
    id: 3,
    name: "Victor Thruster K",
    img: "img/product/hinh15.png",
    priceSale: "3.200.000đ",
    priceOld: "3.600.000đ",
    stars: 5
  },
  {
    id: 4,
    name: "Mizuno Fortius 10",
    img: "img/product/hinh16.png",
    priceSale: "2.990.000đ",
    priceOld: "3.400.000đ",
    stars: 4
  }
];

const ProductListLate = () => {
  return (
    <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-4">
      {productList.map((product) => (
        <ProductCard key={product.id} product={product} />
      ))}
    </div>
  );
};

export default ProductListLate;
